import styles from "./PanelShipStatus.module.css";

const LogMessage: React.FC = () => {

    const [myTest, setMyTest] = React.useState<any>();

    React.useEffect(() => {

//         const fetchMyTest = async() => {
//             const response = await fetch('http://localhost:8080/ship_status');
//             const json = await response.json();
//             setMyTest(json);
//         };

        setMyTest("test 1");

        let count = 0;
        const intervalId = setInterval(() => {
            setMyTest("test: " (count + 1));
        }, 1000);

//         return () => clearInterval(intervalId);
    }, []);

    return (
        <div className={styles.lm_container} >
            <div>Log Message</div>
            <div className={styles.lm_message}>{myTest}</div>
        </div>
    );
}

export default LogMessage;
